fields.description:
When we try access the MRV2 UI, it is always giving the below message in the UI even if the java script enabled in the browser.
{code:xml}
This page works best with javascript enabled. 
{code}

It is trying to download these below css/js files from internet and finally ending up with the above message. For loading the page also it is taking long time.

{code:title=JQueryUI.java|borderStyle=solid}
  html.
      link(join("https://ajax.googleapis.com/ajax/libs/jqueryui/1.8.9/themes/",
                getTheme(), "/jquery-ui.css")).
      link("/static/dt-1.7.5/css/jui-dt.css").
      script("https://ajax.googleapis.com/ajax/libs/jquery/1.4.4/jquery.min.js").
      script("https://ajax.googleapis.com/ajax/libs/jqueryui/1.8.9/jquery-ui.min.js").
{code}

comments.body:
{quote}
Like I said before I don't know how critical these are because everything looks OK on the web page for the most part. It looks like they are trying to be loaded by some of the css that is tied to ui-state-error, ui-widget-content, ui-widget-header and ui-state-default, but I don't know for sure. Some of them are also referenced directly by jquery.min-1.6.4.js.
{quote}

I couldn't notice these files because there was no effect in the page due to these files not present. Thanks for noticing and giving clear details. I think it is better to have all these image files. I have attached jquery-images.tgz for all these images. Please extract it and add all the files in the directory 'hadoop-mapreduce-project/hadoop-yarn/hadoop-yarn-common/src/main/resources/webapps/static/jquery/themes-1.8.16'.


{quote}
Also I am rather curious about the changes that you made to themeswitcher.js.gz. Did you just upgrade to a newer one, or is it modified in some way. If it is modified it is important that we document it so that when we upgrade we can replicate those changes.
{quote}

Here I have modified the themeswitcher.js file to use the local css files present in 'hadoop-mapreduce-project/hadoop-yarn/hadoop-yarn-common/src/main/resources/webapps/static/jquery/themes-1.8.16' instead of accessing from web. 

